import { useState } from "react"



function Login(){

    const login = async () =>{
        var a = document.getElementById("a")
    }

    return(
        
        <div>
           <input placeholder="Seu email" id="a">
           </input>

           <button onClick={login}></button>
        </div>
    )


}export default Login
